//objetos 

const persona = {
    nombre: 'tony',
    apellido: 'stark',
    edad: 45,
    direccion: {
        ciudad: 'New york',
        CP: '6466374',
        lat: '47.8877',
        lng: '34.876574',
    }

};


//console.table({persona});

console.log({persona});

const persona2 = persona;

console.log(persona2);
